// Set the report title and prepare for PDF filename
const reportTitle = $('Style HTML').item.json.report_title || 'Executive Report';
const fileName = reportTitle.replace(/\s+/g, '_') + '.pdf';

// Pass through the binary data with proper filename
const newItem = {
  json: {
    report_title: reportTitle,
    fileName: fileName
  },
  binary: items[0].binary
};

return [newItem];

// Enhance table styling for the executive report
const results = items.map(item => {
  const reportTitle = item.json.report_title || 'Executive Report';
  let htmlString = item.json.html || '';
  const styles = `
    <style>
      body { font-family: Arial, sans-serif; margin: 0; padding: 0; }
      h1 { text-align: center; font-size: 24pt; margin-bottom: 0.5in; }
      h2, h3 { font-weight: bold; margin-top: 0.5in; }
      p { line-height: 1.5; font-size: 12pt; }
      table { width: 100%; border-collapse: collapse; table-layout: fixed; margin-top: 0.25in; }
      thead th { background-color: #f2f2f2; }
      th, td { border: 1px solid #ddd; padding: 5px; font-size: 10pt; text-align: left; vertical-align: top; word-wrap: break-word; }
      @media print {
        body { margin: 0; }
      }
    </style>
  `;
  if (/<head\s*>/i.test(htmlString)) {
    htmlString = htmlString.replace(/<head\s*>/i, `<head>${styles}`);
  } else {
    htmlString = `<head>${styles}</head>` + htmlString;
  }
  if (!/<h1>/i.test(htmlString)) {
    htmlString = htmlString.replace(/<body\s*>/i, `<body><h1>${reportTitle}</h1>`);
  }
  item.json.html = htmlString;
  item.json.report_title = reportTitle;
  return item;
});
return results;

